export function Card() {
  return (
    <div className="w-[20%] bg-[#242424] text-white ">
      <div>
        <img src={monkey} className="h-[60%] w-full"></img>
      </div>
      <div>
        <h3>Scimmia</h3>
        <p>Nord Africa</p>
        <button>Dettagli</button>
      </div>
    </div>
  );
}
